import React from "react";
import {
  SideBar,
  SideBarWrapper,
  SideBarMenu,
  SideBarTitle,
  SideBarListItem,
  SideBarList,
} from "./sideBarElements";

const SideBarD = () => {
  return (
    <>
      <SideBar>
        <SideBarWrapper>
          <SideBarMenu>
            <SideBarTitle></SideBarTitle>
            <SideBarList>
              <SideBarLIstItem></SideBarLIstItem>
            </SideBarList>
          </SideBarMenu>
        </SideBarWrapper>
      </SideBar>
    </>
  );
};

export default SideBar;
